import React from 'react';
import { Link } from 'react-router-dom';
import store from '../../store';

// import store from '../../store';

class Menu extends React.Component {

  constructor(props)
  {
    super(props)
    this.state = {
      login: store.getState().login
    }


  }


  render() {
    return (
      <div className="Menu">
            <ul>
              <li >
                <Link to="/">Home</Link>
              </li>
              { this.props.menu }
            </ul>
      </div>
    )
  }
}

export default Menu;
